import './ButtonBack.css';
import { BsCaretUpFill } from 'react-icons/bs';
import { Link } from 'react-scroll';

const ButtonBack = () => {
  const [getUrl, setUrl] = useState(false);
  const url = window.location.href.split('/')[3];
  (url === '') ? setUrl('home') : setUrl(url);

  return (
    <div className='container button-back'>
      <div className='mdui-ripple mdui-ripple-black'>
        <Link to={getUrl} smooth={true} offset={-100} duration={1000} ><BsCaretUpFill values={{ className: 'icon' }} /></Link>
      </div>
    </div>
  )
}

export default ButtonBack;
